import React, { useState } from "react";
import Button from "../../Button";
import Color from "../../../constants/Color";

const gallery = () => {
  const [living, setLiving] = useState(true);
  const [bed, setBed] = useState(false);
  const [kitchen, setKitchen] = useState(false);

  const Living = () => {};
  const Bed = () => {
    setLiving(false);
    setBed(false);
    setKitchen(true);
  };
  const Kitchen = () => {
    setLiving(false);
    setBed(false);
    setKitchen(true);
  };
  return (
    <div
      className="row"
      style={{ textAlign: "center", justifyContent: "center" }}
    >
      <div
        className="row border"
        style={{
          justifyContent: "center",
          textAlign: "center",
          margin: 20,
          maxWidth: 600,
        }}
      >
        <Button
          text="Living rooms"
          color={Color.primary}
          type={living}
          onPress={() => {
            setLiving(true);
            setBed(false);
            setKitchen(false);
          }}
        />
        <Button
          text="Bedroom"
          color={Color.primary}
          type={bed}
          onPress={() => {
            Bed;
          }}
        />
        <Button
          text="Kitchen"
          color={Color.primary}
          type={kitchen}
          onPress={() => {
            Kitchen;
          }}
        />
      </div>
      <div>Modern</div>
    </div>
  );
};

export default gallery;
